script: |
  super -f text -I q9610.spq | sort > q9610.out

inputs:
  - name: q9610.spq
    data: |
      SELECT col0 + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 34 + col0 + - col2 / - 14 IN ( - col0 + - col2 * - col1 );
  - name: tab2

outputs:
  - name: q9610.out
    data: |
      104
      133
      69
